import React, { useEffect, useState } from 'react';
import Header from "./HeaderComponent";
import Footer from "./FooterComponent";
import { useParams } from 'react-router-dom';

import { Helmet } from 'react-helmet';
import CarCategoriesCard from '../../CarCategoriesCard';

function CategoryDetailCarComponent(){


    const [data, setData] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);
    const { categoria } = useParams(); // Access the route parameter


    useEffect(() => {
      fetchData(categoria);
    }, []);

    const fetchData = async (car) => {
      try {
        const response = await fetch('https://app2.movlife.co/jsongoogle.php?categoria='+categoria); // Replace with your API endpoint
        if (!response.ok) {
          throw new Error('Network response was not ok.');
        }
        const data = await response.json();
        console.log(data);
        setData(data);
        setLoading(false);
      } catch (error) {
        setError(error.message);
        setLoading(false);
      }
    };

    const carCategories = data; // Get the car details based on the route parameter

    if (!carCategories) {
      return <p>Car not found</p>;
    }


    return(
        <div>
            <Helmet>
                <title>Emi Ride Rent a Car Dubai - About Us</title>
                <meta name="description" content="About our renting company, clarify your doubts about renting a car to ride on dubai" />
            </Helmet>

            <Header/>
            <div className="about-us-container">
                <p className="about-us-tittle pt-4">Categoria 1</p>

            <div className='container-fluid'>
                <div className="row row-cols-1 row-cols-md-3 g-4">

                    <CarCategoriesCard title="KIA PICANTO" rutaimg={'static/media/picanto.cf009ce071c741fadacb.webp'} ></CarCategoriesCard>
                    <CarCategoriesCard title="MITSUBISHI ATTRAGE" rutaimg={'static/media/mitsubishi.1bfe3f336ccbd390e584.webp'} ></CarCategoriesCard>
                    <CarCategoriesCard title="KIA PEGAS" rutaimg={'static/media/kiapegas.ca1ef42ff00e3afefd1e.webp'} ></CarCategoriesCard>
                    </div>
                </div>
            </div>

            <Footer/>
        </div>
    )
}

export default CategoryDetailCarComponent;
